import fireImage from 'assets/img/fire.png';
import Page from 'components/Page';

import React, { useState } from 'react';
import { Switch } from 'evergreen-ui';
import { ReactComponent as TimerIcon } from 'assets/img/activity/timer.svg';
import { ReactComponent as ImgIcon } from 'assets/img/activity/img.svg';
import { ReactComponent as ManIcon } from 'assets/img/activity/man.svg';
import { ReactComponent as SoundOnIcon } from 'assets/img/activity/soundon.svg';
import { ReactComponent as RefreshIcon } from 'assets/img/activity/refresh.svg';
import { ReactComponent as MagplusIcon } from 'assets/img/activity/magplus.svg';
import { ReactComponent as MagminusIcon } from 'assets/img/activity/magminus.svg';
import { ReactComponent as PausesoundIcon } from 'assets/img/activity/pausesound.svg';
import { ReactComponent as Refreshsound } from 'assets/img/activity/refreshsound.svg';
import { ReactComponent as Aboutsound } from 'assets/img/activity/aboutsound.svg';
import { ReactComponent as Flagsound } from 'assets/img/activity/flagsound.svg';
import checkedImg from 'assets/img/activity/checked.png';
import oppsImage from 'assets/img/activity/opps.png';
import {
  Button,
  Card,
  CardBody,
  Col,
  Row,
  Input,
  InputGroup,
  InputGroupAddon,
} from 'reactstrap';
import { FormGroup } from '@material-ui/core';

const ActivityThirdPage = () => {
  const [checkedA, setCheckedA] = useState(false);
  const [correctB, setCorrectB] = useState(false);
  const [correctA, setCorrectA] = useState(false);
  const [resultClick, setResultClick] = useState(false);
  const [resultAgain, setResultAgain] = useState(false);
  const [showImg, setshowImg] = useState('');
  const [pBtn, setPBtn] = useState('');
  const [graphShow, setGraphShow] = useState({ display: 'none' });
  const handleClick = () => {
    setCheckedA(!checkedA);
  };
  const correctClick = () => {
    setshowImg('none');
    setGraphShow({});
    setPBtn('90px');
    setCorrectA('true');
  };
  const correctBClick = () => {
    setCorrectB('true');
  };
  const seeResultClick = () => {
    setResultClick('true');
  };
  const resPlayAgainClick = () => {
    setResultAgain('true');
  };
  const upButtonStyle = {
    width: '100px',
    position: 'absolute',
    background: '#E94F2E',
    textAlign: 'center',
    fontFamily: 'Gilroy-SemiBold',
    fontSize: '16px',
    borderWidth: '0px',
  };
  const wordButtonStyle = {
    background: 'rgba(255, 255, 255, 0.08)',
    borderColor: '#018FF7',
    color: 'rgba(255, 255, 255, 0.08)',
    fontFamily: 'Gilroy-Bold',
    width: '45px',
    height: '45px',
  };
  return (
    <Page className="mt-0" style={{ background: '#172231' }}>
      <Row className="p-3">
      <Col className="pt-1">
        <a href="/stmenu">
              <div
                className="ml-3 "
                style={{
                  width: '24px',
                  position: 'absolute',
                  borderRadius: '20px',
                  background: 'rgba(255, 255, 255, 0.2)',
                }}
              >
                <svg
                  className="ml-2"
                  width="6"
                  height="9"
                  viewBox="0 0 6 9"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <path
                    d="M4.80015 1.34287L1.37158 4.77144L4.80015 8.20001"
                    stroke="white"
                    stroke-width="1.37143"
                    stroke-linecap="round"
                    stroke-linejoin="round"
                  />
                </svg>
              </div>

              <span
                className="ml-5"
                style={{
                  color: 'rgba(255, 255, 255, 0.84)',
                  fontFamily: 'Gilroy-Medium',
                  fontStyle: 'normal',
                  fontSize: '16px',
                }}
              >
                Back
              </span>
            </a>
        </Col>
        <Col className="pt-3">
          <Row className="flex-row justify-content-end align-items-center mr-2">
            <div>
              <span
                style={{
                  color: 'white',
                  fontFamily: 'Gilroy-Medium',
                  fontSize: '16px',
                }}
              >
                Autoplay
              </span>
            </div>
            <div className="mt-2 ml-1">
              <Switch
                onChange={handleClick}
                checked={checkedA}
                name="checkedA"
              />
            </div>
          </Row>
        </Col>
      </Row>
      {!correctB ? (
        <Row className="pl-3" style={{ background: '#172231' }}>
          <Col className="col-md-9">
            <Row
              className="flex-row justify-content-center  ml-0 mr-0 border border-1"
              style={{
                height: '420px',
                background: 'rgba(255, 255, 255, 0.08)',
                borderColor: 'gray',
                borderRadius: '15px 0px 0px 0px',
              }}
            >
              <Col className="pr-0 pb-0 mt-5 " md={3} sm={6}>
                <Button
                  style={{
                    position: 'absolute',
                    bottom: '14px',
                    background: 'rgba(255, 255, 255, 0.08)',
                    borderColor: 'rgba(255, 255, 255, 0.1)',
                  }}
                >
                  <ImgIcon />
                </Button>
              </Col>
              <Col md={6} className="flex-row justify-content-center mt-5 mb-0">
                <Row classNam="flex-row justify-content-center mt-4 mb-4 ml-4 mr-4">
                  <Col className="ml-5 flex-row justify-content-center">
                  <div className="ml-5 flex-row justify-content-center" style={graphShow}>
                    <span
                      style={{ fontFamily: 'Gilroy-Regular', color: '#FFFFFF' }}
                    >
                      See the Graphics again?{' '}
                      <span style={{ color: '#018FF7' }}>Click here</span>
                    </span>
                  </div>
                  </Col>
                  <Col md={12}>
                    <Card
                      style={{
                        display: showImg,
                        height: '250px',
                        background: 'rgba(255, 255, 255, 0.08)',
                        borderRadius: '9px!important',
                      }}
                      className="flex-row justify-content-center align-items-center rounded"
                    >
                      <div>
                        <img
                          style={{ width: '100px', height: '100px' }}
                          src={fireImage}
                        />
                      </div>
                    </Card>
                  </Col>
                </Row>
                <Row
                  className="mt-2 ml-1"
                  style={{
                    paddingTop: pBtn,
                    fontSize: '20px',
                    fontFamily: 'Gilroy-Bold',
                  }}
                >
                  <Col md={3} xs={12} className="p-0">
                    <Button style={wordButtonStyle}>R</Button>
                  </Col>
                  <Col md={3} className="d-flex justify-content-center p-0 ">
                    <Button className="border-0 text-white" style={wordButtonStyle}>
                    I
                    </Button>
                  </Col>
                  <Col md={3} className="d-flex justify-content-center p-0">
                    <Button className="border-0" style={wordButtonStyle}>
                    E
                    </Button>
                  </Col>
                  <Col md={3} className="d-flex justify-content-center pl-5 text-white">
                    <Button className="border-0 text-white" style={wordButtonStyle}>
                    E
                    </Button>
                  </Col>
                </Row>
                <Row className="d-flex justify-content-center align-items-end pt-5"><div className="ml-5 mt-5 pt-5" style={graphShow}>
                    <span
                      style={{ fontFamily: 'Gilroy-Regular', color: '#FFFFFF' }}
                    >
                      See the Wordss again?{' '}
                      <span style={{ color: '#018FF7' }}>Click here</span>
                    </span>
                  </div></Row>
              </Col>

              <Col className="d-flex justify-content-end " md={3} sm={6}>
                <Row className="justify-content-end align-items-end mr-3 mb-3">
                  <Button
                    style={{
                      background: 'rgba(255, 255, 255, 0.08)',
                      borderColor: 'rgba(255, 255, 255, 0.1)',
                    }}
                  >
                    <ManIcon />
                  </Button>
                </Row>
              </Col>
            </Row>

            <Card
              className="flex-row justify-content-center align-items-center border-left border-bottom"
              style={{
                height: '85px',
                background: 'rgba(255, 255, 255, 0.08)',
                borderRadius: '0px 0px 0px 15px',
              }}
            >
              <div
                className="ml-3"
                style={{ position: 'absolute', left: '0px' }}
              >
                <Button
                  style={{
                    background: 'rgba(255, 255, 255, 0.08)',
                    borderColor: 'rgba(255, 255, 255, 0.1)',
                  }}
                >
                  <SoundOnIcon />
                </Button>

                <Button
                  style={{
                    background: 'rgba(255, 255, 255, 0.08)',
                    borderColor: 'rgba(255, 255, 255, 0.1)',
                  }}
                >
                  <RefreshIcon />
                </Button>
              </div>
              {!correctA ? (
                <div className="mr-5">
                  <Button
                    onClick={correctClick}
                    style={{
                      background: '#018FF7',
                      borderWidth: '0px',
                      width: '200px',
                      fontFamily: 'Gilroy-SemiBold',
                    }}
                  >
                    Correct
                  </Button>
                </div>
              ) : (
                <div>
                  <Button
                    onClick={correctBClick}
                    style={{
                      background: '#018FF7',
                      borderWidth: '0px',
                      width: '200px',
                      fontFamily: 'Gilroy-SemiBold',
                    }}
                  >
                    Correct
                  </Button>
                </div>
              )}
              <div
                className="mr-5"
                style={{ position: 'absolute', right: '0px' }}
              >
                <Button
                  style={{
                    background: 'rgba(255, 255, 255, 0.08)',
                    borderColor: 'rgba(255, 255, 255, 0.1)',
                  }}
                >
                  <MagplusIcon />
                </Button>
                <Button
                  style={{
                    background: 'rgba(255, 255, 255, 0.08)',
                    borderColor: 'rgba(255, 255, 255, 0.1)',
                  }}
                >
                  <MagminusIcon />
                </Button>
              </div>
            </Card>
          </Col>
          <Col
            className="mb-3"
            md={3}
            style={{
              marginLeft: '-30px',
              fontFamily: 'Gilroy-SemiBold',
              fontSize: '16px',
              color: 'rgba(255, 255, 255, 0.54)',
            }}
          >
            <Card
              className="flex-row ml-0  border border-left-0 border-bottom-0"
              style={{
                height: '130px',
                background: 'rgba(255, 255, 255, 0.08)',
                borderColor: 'gray',
                borderRadius: '0px 15px 0px 0px',
              }}
            >
              <CardBody
                className="mt-1"
                style={{ position: 'absolute', left: '0px' }}
              >
                <span>Time Duration</span>
                <InputGroup className="mt-2">
                  <Input
                    style={{
                      fontFamily: 'Gilroy-Black',
                      fontSize: '24px',
                      color: '#1EB972',
                      borderWidth: '0px',
                    }}
                    value="00:10:49"
                  ></Input>
                  <div
                    style={{
                      background: 'white',
                      borderRadius: '0px 3px 3px 0px',
                      borderWidth: '0px',
                    }}
                  >
                    {/* <svg width="48" height="45" viewBox="-10 0 48 57" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M19.5 2.28C19.5 1.02079 20.5224 -0.00947784 21.7776 0.0911512C25.6366 0.400531 29.4005 1.4937 32.836 3.31268C36.9446 5.48808 40.4587 8.63554 43.0718 12.4806C45.6849 16.3257 47.3177 20.7517 47.8279 25.3726C48.338 29.9935 47.71 34.669 45.9986 38.9915C44.2872 43.3141 41.5444 47.1523 38.0093 50.1716C34.4742 53.1908 30.2541 55.2995 25.7171 56.3136C21.1801 57.3278 16.4638 57.2166 11.9796 55.9899C8.2301 54.9641 4.73799 53.1844 1.71311 50.7683C0.72924 49.9824 0.689188 48.5315 1.55118 47.6136V47.6136C2.41316 46.6956 3.85004 46.6601 4.84578 47.4309C7.31966 49.3459 10.1511 50.7621 13.1829 51.5915C16.9496 52.622 20.9113 52.7153 24.7223 51.8634C28.5334 51.0116 32.0783 49.2403 35.0478 46.7041C38.0173 44.1679 40.3213 40.9438 41.7588 37.3129C43.1964 33.682 43.7239 29.7545 43.2954 25.873C42.8669 21.9914 41.4953 18.2736 39.3003 15.0437C37.1053 11.8139 34.1535 9.16999 30.7022 7.34265C27.9244 5.87186 24.8909 4.96599 21.7766 4.66849C20.5231 4.54875 19.5 3.53921 19.5 2.28V2.28Z" fill="#1EB972"/>
